  return (
    <div className="App">
      <BrowserRouter>
        <Routes></Routes>
        <Route path="/" component={HomePage} />
        {/* <Button colorScheme="blue">Button</Button> */}
      </BrowserRouter>
    </div>
  );
}

export default App;
